INSERT INTO `clinical_history` VALUES (1,0,'Resumen',148,'&lt;p&gt;Paciente de bajos recursos vive alejado de la ciudad. Fue internado en el Garrahan en los primeros meses del a&amp;ntilde;o 2011, por cuadro de descompensaci&amp;oacute;n. No estaba tomando ninguna f&amp;oacute;rmula. Comienza a tomar cooler 10 naranja 3 sobres por d&amp;iacute;a (30 gramos). Actualmente se atiende en Santiago del Estero y la nutricionista le baj&amp;oacute; la dosis a dos pouch por d&amp;iacute;a (20 gramos). Actualmente 23/11/2011 le compran la f&amp;oacute;rmula el Ministerio de Salud y Desarrollo Social de Santiago del Estero&lt;/p&gt;','2011-11-24 00:00:00'),(2,0,'Resumen',133,'&lt;p&gt;Paciente con buena posici&amp;oacute;n econ&amp;oacute;mica, adoptada con diagnostico de Hiperfenilalaninemia. Prob&amp;oacute; los coolers naranja, uva y sin sabor pero le gust&amp;oacute; mas el PKU gel naranja. No tiene mucha restrici&amp;oacute;n en las comidas, puede consumir chocolate normalmente, no necesita VitaBite. el 1/08/2011 enviamos sobres de PKU frambuesa para que pruebe. El pedido lo hace OSDE cada 6 meses.&lt;/p&gt;','2011-11-30 00:00:00'),(3,0,'Resumen',136,'&lt;p&gt;Nov /2011 Paciente de 6 a&amp;ntilde;os de edad, con muchos problemas de conducta y conflicto familiar. que no aceptaba ninguna f&amp;oacute;rmula, estuvo internada con cuadro de desnutrici&amp;oacute;n . Historicamente tomaba Maxamaid en forma de papilla hasta abril de 2011 que comenz&amp;oacute; probando nuestras f&amp;oacute;rmulas. Toler&amp;oacute; bien el PKU gel naranja, frambuesa y sin sabor. Comenz&amp;oacute; tomando PKU gel naranja pero ahora prefiere PKU gel sin sabor porque puede mezclarlo con jugos naturales. En general nos hemos comunicado con su padre con el que tenemos buena relaci&amp;oacute;n.&lt;/p&gt;','2011-11-30 00:00:00'),(4,1,'Resumen',90,'&lt;p&gt;Nov/2011 Paciente de 19 anos. Con buen nivel socio cultural. Hijo de padres separados. Tiene un hermano menor, Franco, que tambien tiene PKU pero no le gustan nuestras formulas. Su madre fue presidenta por varios periodos de la Asociacion de Asistencia al Fenilcetonurico. Marco probo todos los sabores de Coolers pero prefiere el sabor naranja. Su hermano probo todas las opciones de express y cooler pero sigue prefiriendo el Maxamaid. Tenemos buena relacion con su madre, aunque es una persona complicada de tratar que tiene una relacion un poco tirante con OSDE.&lt;/p&gt;\r\n&lt;p&gt;Mayo de 2013: llega orden de OSDE por 12 cajas de PKU cooler 15. El paciente no esta tomando 3 pouches x dia y no podemos calcular bien las cantidades a pedir en las importacion para que no venzan debido al corto vencimiento. Le propusimos ir trayendo de a poco los productos por uso compasivo a su nombre, pero no esta convencido de la opcion.&lt;/p&gt;','2011-11-30 00:00:00'),(5,0,'Resumen',134,'&lt;p&gt;Paciente nacido el 27 de octubre de 2007 con diagn&amp;oacute;sito tard&amp;iacute;o de Tirosinemia Tipo 1. Con una situaci&amp;oacute;n economico social muy carente, no posee Obra Social, actualmente consigue un Subsidio del Gobierno de la Provincia de Santa Fe del Hospital Alassia de la Ciudad de Santa Fe. Viene periodicamente al Hospital Garrahan para tratar su Tirosinemia, quien le sugieren el transplante como alternativa a su cancer de higado pero la familia no acepta transplantarlo por su religi&amp;oacute;n. Es confuso su v&amp;iacute;nculo familiar, su madre y abuelo son los que se est&amp;aacute;n ocupando de su tratamiento. El abuelo aparentemente es su padre. El ni&amp;ntilde;o demuestra gran mejor&amp;iacute;a desde que inicia su tratamiento con NTBC y f&amp;oacute;rmula.&lt;/p&gt;\r\n&lt;br /&gt;','2011-11-30 00:00:00'),(6,0,'Resumen',93,'&lt;p&gt;Nov/2011 Paciente de 4 a&amp;ntilde;os. Con buena posici&amp;oacute;n socio econ&amp;oacute;mica. Tiene dos hermanos mas que no tienen PKU. Su madre es nutricionista y presidente de la Asociaci&amp;oacute;n de Fenilcetonuria de Argentina. Comenz&amp;oacute; a los 3 a&amp;ntilde;os a tomar PKU cooler naranja, luego uva y se cans&amp;oacute; y actualmente toma PKU gel naranja. Le gusta mucho el VitaBite. Tenemos muy buena relaci&amp;oacute;n con su madre. &amp;nbsp;&lt;/p&gt;','2011-11-30 00:00:00'),(7,0,'Resumen',129,'&lt;p&gt;25/11/2010 se enviaron muestras de PKU gel sin sabor, frambuesa y naranja para que pruebe ante problemas de SHS con las f&amp;oacute;rmulas. Toma Maxamaid y seguir&amp;aacute; tomando pero acept&amp;oacute; nuestras f&amp;oacute;rmulas ante un posible desabastecimiento.&lt;/p&gt;','2011-11-30 00:00:00'),(8,0,'Resumen',94,'&lt;p&gt;nov/2011 paciente de 6 a&amp;ntilde;os. Buena situacion socio econ&amp;oacute;mica. Su padre es odont&amp;oacute;logo. Pertenece a la Asociaci&amp;oacute;n Argentina de PKU (Pta Maria Eugenia Zucchi). Tenemos muy buena relacion con su madre que comenz&amp;oacute; queriendo probar nuestros productos conociendo el VitaBite. Antiguamente tomaba Maxamaid comenz&amp;oacute; tomando PKU cooler naranja pero se cans&amp;oacute; y actualmente PKU gel sin sabor que lo incorpora con el t&amp;eacute;.&lt;/p&gt;','2011-11-30 00:00:00'),(9,0,'Resumen',127,'&lt;p&gt;Nov/2011 Paciente adolescente de buena situaci&amp;oacute;n socio econ&amp;oacute;mica. Actualmente viven en Canad&amp;aacute;, su padre el miembro Canadian PKU (www.CanPKU.org) y cuando viaja a Argentina para ver a sus abuelos (Abelino Porto Rector de la UB), siguen manteniendo OSDE y cuando vienen a Bs As piden producto para los meses que est&amp;aacute; en Argentina. Toma 2 PKU cooler 15 naranja y 2 PKU cooler 10 uva por d&amp;iacute;a.&amp;nbsp; A veces dona su formula a los chicos miembros de la Asociaci&amp;oacute;n de PKU de Alejandra Dotta sin cobertura. Carlos se ha reunido con el padre en varias oportunidades.&lt;/p&gt;','2011-11-30 00:00:00'),(10,1,'Resumen',126,'&lt;p&gt;Paciente nacida el 2/09/2006 con Diagnosito de Alteracion de Ciclo de la Urea desde su nacimiento, madre fallecida en el parto con la misma enfermedad, que no fue nunca diagnosticada por ser vegetariana. Actualmente criada por su padre&amp;nbsp;de profesion&amp;nbsp;marino mercante por&amp;nbsp;lo que se encuentra a cargo de sus abuelos cuando embarca. La formula en un principio&amp;nbsp;no era cubierta por la&amp;nbsp;prepaga Galeno&amp;nbsp;aunque actualmente la cubre su Obra social sindical&amp;nbsp;OSJOMN. Es atendida en el Hopistal Ludovica por la Dra. Nunez, a&amp;nbsp;quien&amp;nbsp;le cuesta transmitir directivas nutricionales a la abuela ya que se siente muy triste por la muerte de su hija y le permite a la nieta concesiones alimentarias que no deberia. Tuvo 3 descompensaciones importantes donde fue internada en el Hospital Ludovica. Tiene un retraso motor leve pero su coeficiente intelectual es normal. Actualmente toma EAA Supplement en forma de licuados&amp;nbsp;y periodicamente consume VitaBite&amp;nbsp;.&amp;nbsp;&lt;/p&gt;','2013-05-17 00:00:00'),(11,3,'Resumen',96,'&lt;p&gt;Paciente con fenilcetonuria, adolescente. Vive en Rosario desde hace 4 a&amp;ntilde;os toma 3 cajas de PKU Cooler 15&amp;nbsp;uva por mes y 2 cajas de&amp;nbsp;VitaBite. No le gusta otro sabor. Tenemos poca relaci&amp;oacute;n con los padres porque siempre hemos tomado contacto con el personal de la filial de OSDAAP. Los &amp;uacute;ltimos pedidos los ha hecho&amp;nbsp; Retiro Salud&amp;nbsp; pero hubo problemas con las entregas. Estamos evaluando volver a venderle directamente a OSDAAP.&lt;/p&gt;','2011-12-01 00:00:00'),(12,1,'Resumen',107,'&lt;p&gt;Paciente que consume VitaBite, atendida en la Plata, a trav&amp;eacute;s de Droguer&amp;iacute;a. No tenemos info de la paciente porque nuestro contacto es la Droguer&amp;iacute;a.&lt;/p&gt;','2011-12-01 00:00:00'),(13,1,'Resumen',88,'&lt;p&gt;Paciente de la Dra. Delfina Marchione. Naci&amp;oacute; el 04/08/2003 actualmente con 9 a&amp;ntilde;os, tiene un hermano mellizo (Augusto Andr&amp;eacute;s) y un hermano dos a&amp;ntilde;os mayor (Juan Ignacio). No se conoce que tengan la enfermedad. Se encuentra estable con su acidemia aunque no aumenta la dosis de producto hace 4 a&amp;ntilde;os (MMAPA gel 3 cajas x mes). Nivel socio economico medio. Se entrega en la casa de los abuelos porque el paciente viv&amp;iacute;a en el interior y se han mudado varias veces. Hemos tenido trato con la madre de vez en cuando. (Dominguez Alejandra Pilar) &lt;/p&gt;\r\n&lt;p&gt;en Junio 2012 prob&amp;oacute; el MMAPA cooler RED pero no le gust&amp;oacute; demaciado, va a continuar con el gel. &lt;/p&gt;','2012-07-13 00:00:00'),(14,0,'Resumen',119,'&lt;p&gt;Paciente de Soledad Kleppe vino cuando era muy chiquita (4 meses ) y a&amp;uacute;n no pod&amp;iacute;a tomar nuestras f&amp;oacute;rmulas. Se llev&amp;oacute; Valina para preparar sellos pero luego consigui&amp;oacute; en farmacias. Se descompens&amp;oacute; dos veces. No volvimos a tener contacto con la familia. Viven en Rafaela Santa Fe.&lt;/p&gt;','2011-12-12 00:00:00'),(15,0,'Resumen',139,'&lt;p&gt;Paciente de 4 a&amp;ntilde;os, Viven en Adrogu&amp;eacute;.&amp;nbsp; familia de clase media se atienede en el Hospital Italiano y tamb&amp;iacute;en en el Hospital Ludovica. Nos conoci&amp;oacute; a traves de la Asociaci&amp;oacute;n de PKU con los huevitos de pascua. vino a buscar a mi casa los huevitos que le encantan. Tienen IOMA y Galeno. Prob&amp;oacute; PKU cooler 10 naranja y uva y PKU gel sin sabor, frambuesa y naranja. La Dra. Mariana Nu&amp;ntilde;ez dice que esperemos para hacer alg&amp;uacute;n cambio porque toma bien su formula PKU 1 (3 latas por mes)&lt;/p&gt;','2011-12-12 00:00:00'),(16,0,'Resumen',102,'&lt;p&gt;Paciente del FEI, (Dra. Ana Chiesa) preadolescente de buena posici&amp;oacute;n socioecon&amp;oacute;mica, su padre es piloto de Aerolineas Argentinas. Durante el d&amp;iacute;a es dificil contactar a la familia. Tienen OMINT. Prob&amp;oacute; y le gust&amp;oacute; mucho el VitaBit. el 7/10/2008 enviamos muestras de PKU cooler 10 naranja y PKU gel sin sabor y naranja. No le gust&amp;oacute; mucho, toma Maxamun pero est&amp;aacute; en edad rebelde. No volvimos a insistir aunque nos contactamos todos los a&amp;ntilde;os por los chocolates.&lt;/p&gt;','2011-12-12 00:00:00'),(17,0,'Resumen',128,'&lt;p&gt;Paciente de 16 a&amp;ntilde;os atentido por Dra. Specola, clase media. Le gusta mucho el VitaBite. Tiene Obra Social de Petroleros&amp;nbsp; y compran a trav&amp;eacute;s de Droguer&amp;iacute;a Farmaline S.A. Le gusta el PKU cooler 20 naranja, los sabores uva y sin sabor no le gustan mucho. Tomaba 120 gramos de Maxamaid. Viven en Espeleta pero entregamos en el negocio del padre en Capital.&lt;/p&gt;','2011-12-12 00:00:00'),(18,0,'Resumen',105,'&lt;p&gt;Paciente que consume VitaBite. Problemas con la Obra Social porque tiene Swiss Medical. Estaba interesado en el Doc y KeyOmega para agregar a la f&amp;oacute;rmula. Se lo pidi&amp;oacute; la Dra. Nu&amp;ntilde;ez.&lt;/p&gt;','2011-12-12 00:00:00'),(19,0,'Fallecido',110,'&lt;p&gt;Paciente tratado con NTBC en el Hospital Posadas por la Dra. Patricia Caglio. Falleci&amp;oacute; en Mayo de 2011 por una descompensaci&amp;oacute;n. &amp;nbsp;&lt;/p&gt;','2012-07-13 00:00:00'),(20,0,'Alta',188,'&lt;p&gt;Paciente de 17 a&amp;ntilde;os, diagnosticado con Glucogenosis a los 9 meses de edad,&amp;nbsp; que prob&amp;oacute; el producto Glycosade en USA a trav&amp;eacute;s de su m&amp;eacute;dico Dr. David Weistein de Gainesville, Florida. Tomaba maicena cada 4 horas de d&amp;iacute;a y noche para mantener su glucemias. Con el Glycosade logra dormir 8 horas seguidas.&amp;nbsp;&lt;/p&gt;','2012-08-28 00:00:00'),(21,0,'Alta',166,'&lt;p&gt;Paciente que a&amp;uacute;n no ha sido diagnosticado con sospecha de alteraci&amp;oacute;n de Acidos grasos de cadena larga. A trav&amp;eacute;s del Garrahan solicitaron Lipistart. No tiene Obra social y por lo tanto en una primera instancia solictaron producto a trav&amp;eacute;s de la Municipalidad de Monte y luego se har&amp;aacute; cargo la Naci&amp;oacute;n a trav&amp;eacute;s de Desarrollo Social. No volviern a hacer pedido, no sabemos la causa.&lt;/p&gt;','2012-08-28 00:00:00'),(22,0,'Alta Paciente',189,'&lt;p&gt;Paciente de 3 a&amp;ntilde;os, con Diagnostico de Tirosinemia tipo 1,&amp;nbsp; toma NTBC desde su diagn&amp;oacute;stico. Comeinza tomando Anamix pero como sus controles de Tirosina estan altos, afectandole la visi&amp;oacute;n, resuelven cambiarle por TYR gel. De lo que refiere el padre toma el producto como gel agregandole jugo y tambien como bebida agregando jugo. &amp;nbsp;&lt;/p&gt;','2012-09-12 00:00:00'),(23,0,'Prueba de Producto MSUD gel',156,'&lt;p&gt;Paciente que en el a&amp;ntilde;o 2011 comienza a comprar VitaBite a trav&amp;eacute;s de OSDE. Lo prob&amp;oacute; en el consultorio de la Dra. Specola en la Plata. Compra espor&amp;aacute;dicamente el chocolate.&lt;/p&gt;\r\n&lt;p&gt;En marzo de 2013 se comunica para que le alcancemos f&amp;oacute;rmula MSUD gel para probar otra alterantiva ya que tiene 4 a&amp;ntilde;os y sigue tomando el Maxamiad en mamadera. La Dra. Specola le sugiri&amp;oacute; que intente con el MSUD gel en forma de papilla. Le alcanzamos a su casa en fecha 13/03/2013 del gel a su casa junto con saborizantes flavourpac de naranja y lim&amp;oacute;n y algunas sugerencias de recetas y formas de preparar la f&amp;oacute;rmula. Quedamos atentos a la respuesta.&lt;/p&gt;','2013-03-14 00:00:00'),(24,0,'Deja de tomar fórmula por Kuvan',118,'&lt;p&gt;El paciente vino directamente a trav&amp;eacute;s de la prepaga M&amp;eacute;dicus derivado de la Dra. Ana Chiesa del FEI y durante el per&amp;iacute;odo de Junio de 2009 a Noviembre de 2011 ha tomado el producto PKU cooler 20 naranja una caja por mes.&amp;nbsp;El paciente&amp;nbsp;padece Fenilalaninemia y las pruebas con la medicaci&amp;oacute;n&amp;nbsp;Kuvan le han dado buen resultado, con lo cual ha dejado de tomar&amp;nbsp;nuestra f&amp;oacute;rmula por&amp;nbsp;la administraci&amp;oacute;n de Kuvan.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;','2013-03-14 00:00:00'),(25,0,'Deja de tomar fórmula por Kuvan',91,'&lt;p&gt;Paciente con Hiperfenilalaninemia, fue nuestro primer paciente que comenz&amp;oacute; a tomar PKU cooler 15 naranja, atendida en FEI por la Dra. Ana Chiesa. Su padre de Caleta Olivia es m&amp;eacute;dico. Tiene otro hermano menor sano. La ni&amp;ntilde;a seg&amp;uacute;n lo que refer&amp;iacute;a la Dra. Chiesa no cumpl&amp;iacute;a muy rigurosamente su plan de alimentacion hipoproteico aunque nunca fue muy restringido porque sus niveles de Fenilalanina en sangre no eran tan altos ya que tiene Hiperfenilalaninemia, por eso la Dra. la manten&amp;iacute;a con una dosis de 15 gramos de prote&amp;iacute;nas para cubrir sus requerimientos proteicos y vitam&amp;iacute;ninos. Esta f&amp;oacute;rmula la tom&amp;oacute; desde Enero de 2008 hasta diciembre de 2010.&lt;/p&gt;\r\n&lt;p&gt;Posteriormente la Dra. Chiesa le pasa a PKU cooler 10 naranja porque sus controles de fenilalanina en sangre mejoraron. Esta f&amp;oacute;rmula la tom&amp;oacute; desde enero de 2011 a diciembre de 2011. Luego intentan la prueba con Kuvan y funciona bien con lo cual deja de tomar formula con prote&amp;iacute;nas extentas de fenilalanina.&lt;/p&gt;','2013-03-14 00:00:00'),(26,1,'Visita',125,'&lt;p&gt;&amp;lt;p&amp;gt;03/2013 Machi fue a su casa a llevarle Chupetines con VitaBite de Pascua. Comenz&amp;amp;oacute; el secundario, problemas de adaptaci&amp;amp;oacute;n. Toma el PKU express 3 sobres juntos xq le cuesta tomarlo.En los recreos no come nada de verguenza. Se le habl&amp;amp;oacute; de la alternativa de Neophe. Prob&amp;amp;oacute; con Kuvan y no funcion&amp;amp;oacute;, le flexibilizaron la dieta en esa oportunidad y no le gusto la carne, los alfajores y bombones. Quiere probar las galletitas hipoproteicas. Esta creciendo en percentilos normaes, su madre es escrticta con la dieta&amp;lt;/p&amp;gt;&lt;/p&gt;','2013-04-04 00:00:00'),(27,0,'Baja ',114,'&lt;p&gt;Paciente desde el 2010&amp;nbsp;con acidemia metil mal&amp;oacute;nica con muchos v&amp;oacute;mitos, no recuperaba su peso&amp;nbsp;y deciden&amp;nbsp;hacerle un bot&amp;oacute;n gastrico.&amp;nbsp;Le agregan a la sonda 1,5 sobres x d&amp;iacute;a&amp;nbsp;+ Duocal para cubir calor&amp;iacute;as. Actualmente necesita seguir aumentando calor&amp;iacute;as y le cambian el MMAPA gel por Maxamaid. (abril de 2013)&amp;nbsp;&lt;/p&gt;','2013-05-13 00:00:00'),(28,0,'Seguimiento',121,'&lt;p&gt;Paciente con buena tolerancia a la f&amp;oacute;rmula gel + flavourpac naranja en forma de bebida. Durante el 2013 presenta resistencia a cambiar a la f&amp;oacute;rmula TYR express porque le resulta mas fuerte, pero va a empezar a tomar 2 sobres por d&amp;iacute;a (30 gramos).&lt;/p&gt;','2013-05-13 00:00:00'),(29,0,'Seguimiento',175,'&lt;p&gt;2013 Paciente de 5 a&amp;ntilde;os con diagn&amp;oacute;stico de Zellweger (una mutracion&amp;nbsp;especial), se lo trata como un Zellweger&amp;nbsp;puro. Comienza con DOC Omega. Si bien&amp;nbsp;la enfermedad es degenerativa, la madre del paciente refiere mejoras en&amp;nbsp;su marcada hipoton&amp;iacute;a.&amp;nbsp;Toma 400 gramos x d&amp;iacute;a.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;','2013-05-13 00:00:00'),(30,0,'Seguimiento',113,'&lt;p&gt;Paciente diagnosticado a los 3 a&amp;ntilde;os y 8 meses con FEN de 31mg%. Su tolerancia a la FEN es 250 mg%/mg/d&amp;iacute;a. Tiene rasgos autistas. Crece en percentilo normal de peso y talla.&amp;nbsp;Ha comenzado con Neophe&amp;nbsp;3 frascos&amp;nbsp;por mes y 2 PKU express naranja. Con este&amp;nbsp;tto con los Amino&amp;aacute;cidos Neutros, ha mejorado su autismo y desarrollado sus capacidades cognitivas motrices. Sin embargo su lenguaje presenta un significativo retraso. La&amp;nbsp;obra social&amp;nbsp;(OSPLAD) no quiere comprarle&amp;nbsp;Neophe&amp;nbsp;porque es&amp;nbsp;un producto que a&amp;uacute;n no est&amp;aacute; registrado en el pa&amp;iacute;s&amp;nbsp;x eso se le facturan 5 PKU express x mes y se le entregan 3 frascos de Neophe polvo y 2 PKU Express naranja x mes.&amp;nbsp;&amp;nbsp;&lt;/p&gt;','2013-05-13 00:00:00'),(31,0,'Reporte ',215,'&lt;p&gt;Se enviaron muestras de producto para 4 dias. El segundo dia se notaron diferencia en la tolerancia y en sus glucemias. Se tomo la glucemia cuando estaba haciendo una actividad fisica preocupado porque ya estaba atrasado en la toma del almidon y tenia 100 mg/dl valor que nunca lograba, en general siempre tiene 60 o 70 mg/dl. La Dra. Cabrera esta contenta con los cambios.&lt;/p&gt;','2013-07-18 00:00:00'),(32,0,'Deja de tomar PKU gel',157,'&lt;p&gt;Paciente con hermana con PKU llamada Andrea. La ni&amp;ntilde;a toma Maxamum. El chico comienza a tomar PKU gel naranja, luego se cansa y sigue con PKU gel sin sabor. A fines del a&amp;ntilde;o 2012 refiere inapetencia y valores altos de FEN, por lo que la Dra Chiesa y equipo decide cambiarlo a Maxamaid.&amp;nbsp;&lt;/p&gt;','2013-08-21 00:00:00'),(33,0,'Deja de tomar PKU gel',140,'&lt;p&gt;Paciente que comienza a tomar nuestra f&amp;oacute;rmula a los 2 a&amp;ntilde;os de vida. Adem&amp;aacute;s del PKU gel consumen VitaBite de vez en cuando. Comienza a tomar PKU gel sin sabor, luego pide que se le distribuya en partes iguales los gustos. En la consulta notan que no est&amp;aacute; bien con los micronutrientes y chequeando la f&amp;oacute;rmula ven que le falta Zinc y Selenio, el equipo del FEI le cambia a Maxamaid.&lt;/p&gt;','2013-08-21 00:00:00'),(34,0,'Resumen',176,'&lt;p&gt;Paciente con debut al nacimiento, con una hermano muerto al nacer. toma actualmente Ambutirate y Arginina y EAA Supplement. Su estado cl&amp;iacute;nico es bueno. Atendida por la Dra. Nu&amp;ntilde;ez en La Plata.&lt;/p&gt;','2010-12-02 00:00:00'),(35,0,'Resumen',184,'&lt;p&gt;Paciente que toma los diferentes sabores de la f&amp;oacute;rmula sin dificultad. La Dra. Nu&amp;ntilde;ez est&amp;aacute; probando Kuvan y aparentemente funciona bien. Por ahora acompa&amp;ntilde;a el proceso de cambio con PKU gel naranja y sin sabor. Para cubrir prote&amp;iacute;nas a veces toma PKU express naranja y lim&amp;oacute;n.&lt;/p&gt;','2009-09-03 00:00:00'),(36,0,'Resumen',165,'&lt;p&gt;Paciente nacida el 23 de marzo de 2011 con VLCAD. De buena evoluci&amp;oacute;n. Tiene prohibido ayunar mas de 4hs. Requiere dieta rica de H de C y restringida en grasas hasta 30% del total de Kcal totales. Recibe lipistart (media lata por d&amp;iacute;a) y almid&amp;oacute;n de maiz en caso de necesidad.&lt;/p&gt;','2013-09-03 00:00:00'),(37,0,'Resumen',201,'&lt;p&gt;Paciente nacido el 2 de enero de 2009. Familia con problemas para conseguir el reintegro de la f&amp;oacute;rmula por parte de APROS. La madre es nutricionista y presenta recurso de amparo. Tiene una hermana menor con PKU&lt;/p&gt;','2013-09-03 00:00:00'),(38,0,'Resumen',216,'&lt;p&gt;Paciente con hermano mayor PKU. Si bien es de C&amp;oacute;rdoba se atiende en el Hospita Ludovica de La Plata. toma 10 gramos de proteina por dia. Como APROSS tiene convenio con Nutricia le queren entregar Anamix pero la ni&amp;ntilde;a no lo acepta.&lt;/p&gt;','2012-05-02 00:00:00'),(39,0,'Resumen',195,'&lt;p&gt;Paciente diagnosticada al nacimiento, de nacionalidad paraguaya. Estuvo en UTI del Garrahan y lograron compensarla. Sin secuelas. La madre cumple con las indicaciones dietarias. Consume NTBC a trav&amp;eacute;s del Ministerio de Desarrollo Social. Acepta bien el PKU gel pero el Ministerio le provee Maxamaid.&lt;/p&gt;','2013-09-03 00:00:00'),(40,0,'Resumen 2',88,'&lt;p&gt;Paciente que por su edad debe cambiar a MMAPA express pero el ni&amp;ntilde;o no tolera la nueva f&amp;oacute;rmula, como est&amp;aacute; bien metabolicamente y su madre el m&amp;eacute;dica no est&amp;aacute; decidia a hacer el cambio pero consume muy poca prote&amp;iacute;na solo 20 gramos x d&amp;iacute;a.&lt;/p&gt;','2013-09-03 00:00:00'),(41,0,'Resumen',153,'&lt;p&gt;Paciente nacido el 2 de abril de 2010. Muy iquieto y activo. Toma 40 gramos de proteinas por d&amp;iacute;a con PKU gel sin sabor que lo toma junto con jugo Cepita. Su madre esta separada. Tienen problemas para el reintegro por parte de Galeno. Tuvieron que presentar un recurso de amparo. Se atiende en FEI&lt;/p&gt;','2013-09-03 00:00:00'),(42,0,'Resumen',221,'&lt;p&gt;Paciente mayor de edad 27 a&amp;ntilde;os&amp;nbsp;con diagn&amp;oacute;stico tard&amp;iacute;o de deficit de CPT2, cursa con Obesidad. Derivado por Dr. andres Belardi del Hospital Austral. Lo atiende Silvana Lavorgna en forma particular. Debe tomar 1 sobre de MCT Procal por d&amp;iacute;a. Actualmente est&amp;aacute; en prueba con el producto e intentando que su Obra Social cubra el tratamiento. Trabaja en un centro de d&amp;iacute;a de chicos discapacitados.&lt;/p&gt;','2013-09-03 00:00:00'),(43,0,'Resumen',181,'&lt;p&gt;Paciente PKU derivado por la Dra. Nu&amp;ntilde;ez, toma PKU gel naranja 3 caja x mes&amp;nbsp;sin inconvenientes.&lt;/p&gt;','2013-09-03 00:00:00'),(44,0,'Resumen',120,'&lt;p&gt;Paciente diagnosticada tard&amp;iacute;amente de PKU a los 13 a&amp;ntilde;os en FESEN. Es atendida por la Dra. Szlago y la Lic. Lavorgna. Tiene un retraso madurativo leve. Desde un comienzo la unica formula aceptada es PKU cooler uva y naranja. Actualmente se cans&amp;oacute; del sabor naranja y consume solo uva. Cumple con la dieta satisfacoriamente a pesar de su diagnostico tard&amp;iacute;o.&lt;/p&gt;','2013-09-03 00:00:00'),(45,0,'Resumen',142,'&lt;p&gt;Paciente con PKU diagnosticado al nacimiento. Su madre es muy dedicada en cuanto a sus cuidados. Son de Lomas de Zamora de clase humilde. Toma 4 cajas de PKU gel sin sabor y a veces VitaBite. Tomaba anteriormente Anamix y Maxamaid con dificultad. Se atiende en el FEI. Curso con un cuadro alergico fuerte que no sab&amp;iacute;an a que correspond&amp;iacute;a ten&amp;iacute;a miedo su madre que fuera la f&amp;oacute;rmula pero finalmente era un producto de limpieza.&lt;/p&gt;','2013-09-03 00:00:00'),(46,0,'Resumen',169,'&lt;p&gt;Paciente de Mar del Plata muy inestable, se descompensa seguido porque se mueve mucho y deben internarlo en el Hospital Garrahan. No logran estabilizarlo. Comienza en marzo de 2012 a tomar Lipistart ya que hab&amp;iacute;a problemas con la importaci&amp;oacute;n de Monogen. Como lo tolera bien, deciden seguir con la f&amp;oacute;rmula. en sep/2013 la madre me informa que vuelve a estar internado por descompensaci&amp;oacute;n.&lt;/p&gt;','2013-09-03 00:00:00'),(48,0,'Resumen',178,'&lt;p&gt;Paciente con PKU de 22 a&amp;ntilde;os con diagnostico tardio a los 24 meses de vida, con valores de 35 mg/dl. Tiene da&amp;ntilde;o mental que requiere educaci&amp;oacute;n especial. Sus padres estan separados, y el padre se hace cargo de su dieta. Toma&amp;nbsp;PKU express naranja&amp;nbsp;(15 gramos de proteinas) y Neohphe&amp;nbsp;polvo. Al empezar con&amp;nbsp;los Amino&amp;aacute;cidos neutros a mejorado su atenci&amp;oacute;n. Su actitud era muy autista y ahora est&amp;aacute; mas integrada a la familia, presta mas atenci&amp;oacute;n.&amp;nbsp;Ha sido positivo su cambio de f&amp;oacute;rmula.&amp;nbsp;&lt;/p&gt;','2013-09-03 00:00:00'),(49,0,'Resumen',124,'&lt;p&gt;Paciente de 11 a&amp;ntilde;os con PKU. Es atendido en el Hospital Ludovica. Su madre cocina bien y siempre le ha cuidado la dieta. Es paciente desde principios de 2011. Tomaba PKU gel naranja y ahora cambi&amp;oacute; a PKU Express limon. Compra pocos alimentos hipoproteicos porque su madre le prepara tapas de empanadas etc. La Dra. Specola le ha pedido que vaya armando un recetario para el Hospital Ludovica.&lt;/p&gt;','2013-09-03 00:00:00'),(50,0,'Resumen',223,'&lt;p&gt;Paciente que desde hace 7 a&amp;ntilde;os es paciente de IM. Toma NTBC y por su edad debe comenzar a tomar mas prote&amp;iacute;nas por lo que solictaron TYR express para probar tolerancia.&lt;/p&gt;','2013-09-03 00:00:00'),(51,1,'Resumen',89,'&lt;p&gt;&amp;lt;p&amp;gt;Paciente con diagn&amp;amp;oacute;stico tard&amp;amp;iacute;o de PKU con un leve retraso madurativo, que le crea inseguridades. Actualmente trabaja pero vive con su madre. Consum&amp;amp;iacute;a PKU cooler&amp;nbsp;20 naranja y sin sabor, sin embargo la Dra. Specola se anima a liberarle un poco la dieta y darle aminoacidos neutros ya que expresa que no tienen intenciones de ser madre. Comienza con &amp;amp;nbsp;Neophe en tabletas, dividida&amp;amp;nbsp;la dosis &amp;amp;nbsp;antes de las comidas a lo largo del d&amp;amp;iacute;a. Deja de tomar f&amp;amp;oacute;rmula y a nivel an&amp;amp;iacute;mico se encuentra mas integrada y con menos miedos. Fue un cambio positivo&amp;lt;/p&amp;gt;&lt;/p&gt;','2013-09-03 00:00:00'),(52,0,'Evolución',189,'&lt;p&gt;La paciente no toma la formula regularmente como deberia, y sus controles de Tirosina no son buenos, ya comenzandole a afectar su visi&amp;oacute;n.&lt;/p&gt;','2013-09-03 00:00:00'),(53,0,'Resumen',147,'&lt;p&gt;Pacientes mellizos ambos con PKU. viven en Charata provincia de Chaco. Los ni&amp;ntilde;os comienzan tomando PKU gel naranja y lo toleran bien. Ahora ya han pasado al PKU express naranja que es el que mas les gusta pero tambien limon es aceptado. Su familia tiene escasos medios economicos&amp;nbsp;pero cuentan con&amp;nbsp;la obra social de peones rurales (UATRE) .&lt;/p&gt;','2013-09-03 00:00:00'),(54,0,'Resumen',154,'&lt;p&gt;Paciente con PKU, la Dra Ana Chiesa resuelve cambiarla a PKU gel porque tomaba Anamix con dificultad y come poco. Tolera todos los sabores pero la Dra prefiere incluirle mas producto sin sabor para que no se canse. Tiene una hermana mayor con Sindrome de Down con problemas deglutorios. Cuando conoc&amp;iacute; a la madre estaba muy angustiada por la situacion de que la ni&amp;ntilde;a no se alimentaba bien. Le dimos el DVD con los consejos de como tomar la formula. Actualmente esta bien metabolicamente y la formula la toma sin problemas.&lt;/p&gt;','2013-09-03 00:00:00'),(55,0,'Resumen',123,'&lt;p&gt;Paciente PKU diagnosticada al nacimiento con hermana melliza sana. Se atiende en FEI. tolera bien el PKU gel sin sabor. Sus padres est&amp;aacute;n separados, su madre se ocupa de su alimentaci&amp;oacute;n. compran VitaBite de vez en cuando particularmente.&lt;/p&gt;','2013-09-04 00:00:00'),(56,0,'Resumen',111,'&lt;p&gt;Paciente con diagnostico tardio de Jarabe de Arce. Tiene deficiencia mental, es una adulta con&amp;nbsp;mentalidad de nena de 10 a&amp;ntilde;os. Estuvo varios a&amp;ntilde;os&amp;nbsp;sin tomar&amp;nbsp;f&amp;oacute;rmula. La diagnosticaron en La Plata cuando era&amp;nbsp;chica y luego dejo de venir a Buenos Aires, son de Simoca Tucuman. Un neur&amp;oacute;logo local les dijo que ya no hacia falta que se controle con la dieta y dejo de hacerlo. Actualmente comenzo a tomar&amp;nbsp;MSUD express 3 sobres por dia y alimentos hipoproteicos,&amp;nbsp;segun lo que refiere la madre la&amp;nbsp;chica esta mas integrada y&amp;nbsp;mas tranquila tambien.&amp;nbsp;La madre es Consejal de&amp;nbsp;Simoca y separada.&amp;nbsp;El padre de la chica&amp;nbsp;no se hace cargo de la situacion. Periodicamente y con dificultad envian muestras de sangre a la Dra. Specola para&amp;nbsp;su analisis. No viaja por cuestiones economicas.&amp;nbsp;&lt;/p&gt;','2013-09-04 00:00:00'),(57,0,'Resumen',117,'&lt;p&gt;Paciente PKU adolescente. Antiguamente tomaba Maxamaid y comenz&amp;oacute; tomando PKU express limon. Luego sigui&amp;oacute; con PKU cooler 15 naranja, no le gusta el sabor uva. Le modifican a PKU cooler 20 naranja, pero est&amp;aacute; probando con Kuvan con buenos resultados, le estan liberando la dieta. Por ahora continua con PKU cooler 20&lt;/p&gt;','2013-09-04 00:00:00'),(58,0,'Resumen',213,'&lt;p&gt;Paciente con Homocistinuria detectada muy tardiamente a los 7 a&amp;ntilde;os. Presenta un retraso mental importante. Se atiende en el Garrahan y su padres estan separados. Su madre esta con una nueva pareja y es el padrasto el que se hace cargo de los tramites de la ni&amp;ntilde;a. Comienza con HCU gel 3 cajas por mes con buenos resultados.&lt;/p&gt;','2013-09-04 00:00:00'),(60,0,'HC original',89,'Paciente: Paskiewicz, Mirtha\r\nDNI 25641613\r\nFN 26/10/76\r\nDiagnostico Fenilcetonuria\r\nDra Norma Specola\r\nFecha actual 9/9/13\r\nPaciente de 35 a&ntilde;os con diagnostico de Fenilcetonuria Clasica en tratamiento desde los 2 a&ntilde;os de vida. Diagnostico tard&iacute;o ante presencia de sgnos neurol&oacute;gicos en laboratorio Chamoles. \r\nInicia tratamiento logrando descender los niveles y manteniendo luego dosajes entre 4 y 6 mg% durante los primeros a&ntilde;os de vida.\r\nDesde los 9 a&ntilde;os consulta a nuestro servicio y es atendido hasta la fecha. Realiza dieta restringida en Feninalanina y controlada regularmente con dosajes sangu&iacute;neos. Mirtha tiene una tolerancia de 600mg de feninalanina a trav&eacute;s de su dieta frutovegetariana controlada. Para completar los requerimientos cal&oacute;ricos recibe alimentos hipoproteicos. Los requerimientos proteicos, vitam&iacute;nicos y minerales son cubiertos por una mezcla de amino&aacute;cidos sin feninalanina.\r\nEn relaci&oacute;n al diagnostico tard&iacute;o de su enfermedad, Mirtha presenta una insuficiencia mental moderada sin trastornos motores ni sensoriales. Estado nutricional bueno. Peso 62kg Talla 163cm. Todos los par&aacute;metros dentro de limites normales. \r\nDesde Nov/11, la paciente ha cambiado su tratamiento nutricional cl&aacute;sico con suplemento de mezclade amino&aacute;cidos neutros (Neophe) de modo de competir con la feninalanina en el pasaje de la barrera hematoencefalica y poder liberar parcialmente la dieta tan restringida. Esta terapia es de uso com&uacute;n en adultos con PKU que ya no necesitan mantener niveles de feninalanina tan controlados. . De esta manera mejora el nivel cerebral de dopamina y serotonina con la consiguyiente mejora de su estado an&iacute;mico e iniciativa y se libera a la familia de un control tan estricto de la dieta. \r\nEn la acutalidad Mirtha mantiene un examen neurol&oacute;gico normal con caracterisitcas de su deficiencia mental leve. Pero ha mejorado significativamente su estado an&iacute;mico y capacidad de comunicaci&oacute;n de sus necesidades familiares, ha mejorado su iniciativa a actividades nuevas y su orientacion general lo que permite cierta independencia en el desplazamiento fuera de su domicilio. \r\nRecibe 40 comp de Neophe diarios. Al haber diversificado la dieta no necesita pesar alimentos ni otros suplementos nutricionales y asi ha logrado independencia. \r\n\r\n    	    \r\n                                        \r\n                                    ','2014-06-24 00:00:00'),(61,0,'HC original',113,'Paciente Villar Nicolas\r\nDra Patricia Papendieck\r\nFN 8/3/97\r\nEl paciente padece Fenilcetonuria diagnosticada con valores de feninalanina elevados en sangre 31mg% (valores normales hasta 2mg/dl) a los 3 a&ntilde;os y 8 meses de edad\r\nDesde entonces hasta la actualidad recibe una dieta restringida en feninalanina y especialmente elaborada en forma individual bas&aacute;ndose en los controles mensuales de sangre y en los registros alimentarios correspondientes a los 3 dias previos al control.\r\nSu tolerancia diet&eacute;tica a la feninalanina es de aprox 250 mg % mg/dia\r\nEl control de Nicolas comprende una rigurosa dieta que la madre lleva a cabo y la atenci&oacute;n en centro especializado que funciona en nuestra instituci&oacute;n. Dentro de los controles que debe realizar se cuentan controles de sangre por m&eacute;todo fluorometrico, controles m&eacute;dicos cada 4 meses y un control madurativo anual. La madre informa lo comido por el ni&ntilde;o los d&iacute;as previos al control de sangre y la nutricionista del equipo devuelve los resultados con la interpretaci&oacute;n, dieta y recomendaciones\r\nNicolas crece normalmente. A los 16 a&ntilde;os y 3 meses tiene un peso de 72 kg y una talla de 174cm adecuados para su estadio puberal avanzado. Ha evolucionado muy favorablemente, perdiendo rasgos autistas y desarrollando capacidades cognitivas y motrices. Sin embargo, en el &aacute;rea del lenguaje presenta un significativo retraso que hace necesaria su asistencia en un centro educativo terap&eacute;utico en jornada completa para continuar su rehabilitaci&oacute;n.\r\nHa surgido en su seguimiento una dificultad importante para lograr el control metabolico deseado y cubrir las recomendaciones nutricionales adecuadas a su edad\r\nEsto redunda en dificultades para lograr la rehabilitaci&oacute;n por lo que se ha indicado Neophe Polvo \r\nGramos por dia, 5 frascos por mes\r\nLa rehabilitaci&oacute;n se completa con fonoaudiolog&iacute;a y estimulaci&oacute;n psicopedag&oacute;gica.\r\n   	    \r\n                                        \r\n                                    ','2014-06-24 00:00:00'),(62,0,'HC original',216,' Ce pri met\r\nCordoba 16/7/13\r\nPaciente Bosio Emma\r\nFN 02/05/12\r\nNi&ntilde;a, 2da hija de padres sanos, no consangu&iacute;neos, nacida por cesarea luego de un embarazo normal, controlado \r\nTeniendo en cuenta el antecedente familiar de un hermano afecto de fenilcetonuria cl&aacute;sica, se comenzaron los controles de feninalanina en el periodo neonatal y posteriores. En todos resultaron elevados dentro del diagnostico de hiperfeninalanina. Estuvo siempre alimentada por pecho materno\r\nSe confirma diagnostico de Fenilcetonuria en junio 2012 comenzando desde entonces dietas restrictivas en feninalanina\r\nEn el momento actual su desarrollo y crecimiento es escaso. Peso 8.450 (P25), Talla 70cm (P25-50)\r\nLos controles de feninalanina son estables dentro de los valores normales esperados para PKU\r\nSe indican los siguientes alimentos\r\nPKU gel de Vitaflo, 1 sobre por dia. Consumo mensual de 1 caja\r\nAlimentos hipoproteicos para 6 meses\r\nHarina Hipoproteica \r\nFideos Aproten\r\nGalletitas Aproten\r\nFette tostate Aproten\r\nSusituto de Huevo\r\nBarra Vita Bite\r\nCrackets\r\nEl cumplimiento estricto de la dieta favorece el desarrollo y previene complicaciones neurol&oacute;gicas y cognitivas propias de esta patolog&iacute;a librada a su evoluci&oacute;n natural\r\n   	    \r\n                                        \r\n                                    ','2014-06-24 00:00:00'),(63,0,'Resumen',217,'01/2014 Paciente que tomaba Anamix Junior pero no lo traen mas. 6/2014 me piden presupuesto cotizo PKU gel y PKU cooler 10. No se confirma la cotizaci&oacute;n.   Me contacto con Silvana Lavorgna que me cuenta que es un paciente de Rio Gallegos, que hace mucho no ve, antes iba a controles en el Garrahan. Ahora lo siguen desde Rio Gallegos el Lic. Kero, logro contactarlo por mail y me cuenta que el ni&ntilde;o tiene casi 12 a&ntilde;os, muy rebelde, con mal control metab&oacute;lico 11 mg de Fenilalanina . Se controla cada 7 d&iacute;as y concurre con registros alimentarios. Est&aacute; consumiendo 35 mg prote&iacute;nas con la formula.  Desde que lo controlan siempre tuvo valores altos de Fenilalanina. Actualmente toma Maxamaid XP. 06/2014 Le env&iacute;o muestras al Hospital Regional de Rio Gallegos de PKU express 3 sabores, PKU Cooler 20 uva y naranja y 1 fascco de Neophe tabletas. Le envi&eacute; Guia de productos de Vitaflo y Gu&iacute;a para padres de PKU de Medgen.      \r\n\r\n                                        \r\n                                    ','2014-06-27 00:00:00'),(64,0,'Novedades',184,'&lt;p&gt;En una charla con la madre nos comentaba que en el Hospital Ludovica donde lo atienden, comenzaron a probar con Kuvan. Para esto lo mantuvieron sin f&amp;oacute;rmula una semana y notaron que los valores de Fenilalanina no sub&amp;iacute;an segun lo esperado. La prueba no pudieron hacerla y sospechan un mal diagn&amp;oacute;stico de PKU pasa a ser Hiperfenilalaninemia. En la actualidad est&amp;aacute; con un sobre de PKU gel por d&amp;iacute;a (10 gramos de prote&amp;iacute;nas) y la dieta bastante liberada, hasta est&amp;aacute; incorporando carnes. El ni&amp;ntilde;o est&amp;aacute; estabilizado en valores de Fenilalanina aunque tiene problemas de conducta en el Jard&amp;iacute;n de infantes, refiere agresividad. Seg&amp;uacute;n la madre se trata de que es malcriado porque es hijo &amp;uacute;nico pero la Dra. Specola quiere seguir haciendole pruebas para descartar que no sea la Fenilalanina alta que altera su caracter. No consume alimentos hipoproteicos en la actualidad.&lt;/p&gt;','2015-01-21 00:00:00');
